import React, { useState } from "react";
import "./ConvertUrl.css";

function ConvertUrl() {
  const [urllist, setUrlList] = useState("Test Url list");

  function shortUrlList() {
    //console.log("show short list");
    setUrlList("Test Url list");
  }

  return (
    <div className="container">
      <h1>URL SHORTENER</h1>
      <div className="information">
        <form className="row g-2">
          <div className="col-9">
            <label htmlFor="inputPassword2" className="visually-hidden">
              Password
            </label>
            <input
              type="text"
              className="form-control form-control-lg"
              id="inputPassword2"
              placeholder="Password"
            />
          </div>
          <div className="col-3">
            <button
              className="btn btn-primary btn-lg mb-3"
              onClick={shortUrlList}
            >
              Shorten
            </button>
          </div>
        </form>
        {urllist}
      </div>
    </div>
  );
}

export default ConvertUrl;
